"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[800],{4382:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"workshopSidebar":[{"type":"link","label":"Overview","href":"/cube-workshop/docs/intro","docId":"intro","unlisted":false},{"type":"link","label":"Workshop Setup","href":"/cube-workshop/docs/setup","docId":"setup","unlisted":false},{"type":"category","label":"Workshop Exercises","items":[{"type":"link","label":"Data Modeling with Cube","href":"/cube-workshop/docs/data-modeling/","docId":"data-modeling/index","unlisted":false},{"type":"link","label":"Access Control with Cube","href":"/cube-workshop/docs/access-control/","docId":"access-control/index","unlisted":false},{"type":"link","label":"Caching with Cube","href":"/cube-workshop/docs/caching/","docId":"caching/index","unlisted":false},{"type":"link","label":"APIs: Multiple Ways to Access Data","href":"/cube-workshop/docs/apis/","docId":"apis/index","unlisted":false},{"type":"link","label":"Building a React Dashboard","href":"/cube-workshop/docs/react-app/","docId":"react-app/index","unlisted":false},{"type":"link","label":"D3 Agentic Analytics","href":"/cube-workshop/docs/d3-analytics/","docId":"d3-analytics/index","unlisted":false}],"collapsed":true,"collapsible":true},{"type":"link","label":"Resources & Next Steps","href":"/cube-workshop/docs/resources","docId":"resources","unlisted":false}]},"docs":{"access-control/index":{"id":"access-control/index","title":"Access Control with Cube","description":"Cube provides comprehensive security features that go beyond simple row-level filtering. You can implement row-level security, column-level masking, control cube and view visibility, and build multi-tenant architectures - all applied automatically across every query, regardless of the API used.","sidebar":"workshopSidebar"},"apis/index":{"id":"apis/index","title":"APIs: Multiple Ways to Access Data","description":"Cube provides multiple APIs to access your data, making it easy to integrate with any application, tool, or workflow. Every API uses the same underlying data model and security rules.","sidebar":"workshopSidebar"},"caching/index":{"id":"caching/index","title":"Caching with Cube","description":"One of Cube\'s most powerful features is its sophisticated caching system that can dramatically improve query performance and provide higher concurrency for analytical workloads. Instead of hitting your database every time, Cube can serve results from optimized caches that are orders of magnitude faster.","sidebar":"workshopSidebar"},"d3-analytics/index":{"id":"d3-analytics/index","title":"D3 Agentic Analytics","description":"D3 is Cube\'s revolutionary natural language interface for data analytics. Instead of writing complex queries or building charts manually, simply ask questions in plain English and get instant insights, charts, and analysis!  D3 leverages Cube\'s semantic layer to provide accurate, secure, and fast responses based on your business data model.","sidebar":"workshopSidebar"},"data-modeling/index":{"id":"data-modeling/index","title":"Data Modeling with Cube","description":"Data modeling is the foundation of any analytics application. In Cube, you define measures (what you want to calculate) and dimensions (how you want to group and filter) to create a semantic layer over your raw data.  The logic is organized into cubes which represent logical datasets, generally mapping one-to-one with tables in a star schema.","sidebar":"workshopSidebar"},"intro":{"id":"intro","title":"Overview","description":"Welcome to Building Analytics Applications with Cube! This 3-hour hands-on workshop will teach you how to build modern analytics applications using a Cube Semantic Layer.","sidebar":"workshopSidebar"},"react-app/index":{"id":"react-app/index","title":"Building a React Dashboard","description":"In this comprehensive workshop, we\'ll build a professional analytics dashboard for TPC-H data from the ground up. You\'ll learn how to create a modern React application that connects to Cube\'s semantic layer, implements secure authentication, and displays interactive charts with role-based access control.","sidebar":"workshopSidebar"},"resources":{"id":"resources","title":"Resources & Next Steps","description":"Congratulations! You\'ve completed the WDC 2025 Cube Semantic Layer Workshop and built a comprehensive analytics application. Here\'s how to continue your Cube journey.","sidebar":"workshopSidebar"},"setup":{"id":"setup","title":"Workshop Setup","description":"Before we dive into building with Cube, let\'s get your environment ready.","sidebar":"workshopSidebar"}}}}')}}]);